import React from "react";
import TaskForm from "./TaskForm";
import Header from "./Header.js";
import TaskListContainer from "./TaskListContainer";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Header />
      <TaskForm />
      <TaskListContainer />
    </div>
  );
}

export default App;
